import React, { Component } from 'react';

class MoreInfo extends Component {

	render() {
		let live = ""
		if (localStorage.live !== ""){
			live = <h3><a href={localStorage.live}>live</a></h3>
		}
		return(
			<div className= "moreInfo">
				<div className = "grid">
					<h2 className = "inflex">Links</h2>
					<h2 className = "inflex">Specs</h2>
					<h3 className = "inflex"><a href={localStorage.github}>github</a></h3>
					<h3 className = "inflex"><a href={localStorage.demo}>video</a></h3>
					{live}
				</div>
			</div>
		)
	}
}

export default MoreInfo
